    return (
      <div>
        <select id="SelectUnit" onChange={this.getUnit}>
          <option value="N/A">Select Unit</option>
          <option value="1">LENGTH</option>
          <option value="2">MASS</option>
          <option value="3">VLOUME</option>
          <option value="4">TEMERATURE</option>
        </select>
      </div>
    );
  }
}
